import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';

import DialogBox from "./DialogBox";
import SelectProvider from "./SelectProvider";
import OfferCards from "./OffersCards";
import PaymentQrCode from "./PaymentQrCode";
import PaymentForm from "./PaymentForm";
import SuccessfulPayment from "./SuccessfulPayment";
import GetYourCard from "./GetYourCard";
import LoginForm from "./LoginForm";
import HistoryTable from "./HistoryTable";

function App() {
  return (
    // <div className="App">
    //   <header className="App-header">
    //     <img src={logo} className="App-logo" alt="logo" />
    //     <p>
    //       Edit <code>src/App.js</code> and save to reload.
    //     </p>
    //     <a
    //       className="App-link"
    //       href="https://reactjs.org"
    //       target="_blank"
    //       rel="noopener noreferrer"
    //     >
    //       Learn React
    //     </a>
    //   </header>
    // </div>
    <Router>
      <Switch>
        <Route path="/" exact component={DialogBox} />
        <Route path="/select-provider" component={SelectProvider} />
        <Route path="/offer-cards" component={OfferCards} />
        <Route path="/payment-qr-code" component={PaymentQrCode} />
        <Route path="/payment-form" component={PaymentForm} />
        <Route path="/successful-payment" component={SuccessfulPayment} />
        <Route path="/get-your-card" component={GetYourCard} />
        <Route path="/login-form" component={LoginForm} />
        <Route path="/history-table" component={HistoryTable} />
      </Switch>
    </Router>
  );
}

export default App;
